import React from "react";
import ReactDOM  from "react-dom";
import {add, min, mul, div} from "./Cal"


ReactDOM.render(
    <>
      <h1>your Number is {add(10,10)} </h1>
      <h1>your Number is {min(10,5)} </h1>
      <h1>your Number is {mul(10,10)} </h1>
      <h1>your Number is {div(10,2)} </h1>
    </>,
    document.getElementById("root")
);
